      percent: 60,
    },
  ];

  const handClickDraw = () => {
    setIsDraw(true);
    console.log(isDraw);
    setIsDraw(false);
  };

  return (
    <React.Fragment>
      <Header />
      <button onClick={handClickDraw}>Click Me!</button>
    </React.Fragment>
  );
}

